Description . Head : Vertex and upper frons pale brownish gray, apices of scales paler; labial palpus concolorous with vertex, third segment 0.36 length of second (
1 ♂
).

Thorax : Prothorax and patagia, mesothorax and tegulae, and metathorax pale grayish brown. Forewing (
Fig. 4
) length 4.4–7.9 mm ; sex scales absent in male; outer margin of wing membrane concave; grayish brown from base to two-thirds length, suffused with orange on outer third, with silvery lines originating from six white strigulae on costa, two transverse silvery lines at mid-wing, often indistinct in rubbed specimens, a Y-shaped silvery line at two-thirds length, often with apical arm discontinuous from stalk, and a discontinuous Y-shaped silvery line near apex, with both arms broken at stalk by orange tipped scales; basal half of wing with three or four transverse striae, formed by scales with white or light gray apices; a small white or light gray spot on proximal margin of stalk of first Y-shaped silvery line; scale apices increasing in amount of orange from before mid-wing to Y-shaped silvery line at two-thirds length; ocellus with 3–4 dark brown longitudinal bars between stalks of Y-shaped silvery lines; scales of apical third of wing orange or brownish gray with orange apices; distal row of wing disc scales (basal to attenuate marginal scales) forming dark brown line, broken by white dash at M 1 ; marginal scales dark gray. Hindwing uniformly light brownish gray; cubital pecten poorly developed, anal pecten well developed, originating at wing base between 3 A and 1 A+ 2 A; remainder of dorsal surface without long setae. Male with 51 to 65 ( 2 n) setiform sex scales bordering marginal third of 3 A (
Fig. 11
), apex of sex scale with at least 16 longitudinal ridges (
Fig. 12
), sockets large relative to sockets of other wing scales; marginal third of 3 A in male thickened and appearing grooved; wing margin crimped near 3 A.

Abdomen : Male genitalia (
Fig. 6
) with tegumen band-like, dorsally widened, with posterior margin inflected inwardly; uncus and socii absent; gnathos sclerotized basally, membranous apically; phallus 0.72–0.77 length of valva ( 4 n), sclerotized apex of phallus curved ventrally, ventral margin with 4–7 dentitions, dorsal margin unsclerotized from midlength to apex, forming elliptical opening, vesica with patch of 27–34 non-deciduous cornuti medially and 3–4 non-deciduous cornuti apically; anellus closely surrounding base of phallus; valva with deep, apically directed, ventral incurvation of neck, cucullus delimited by flange that widens dorsally, lower area of cucullus and neck without setae, costa densely setose except at base, sacculus with setose lobe on ventro-apical margin of basal opening. Ten preparations examined. Female genitalia (
Fig. 7
) with sternum VII deeply excavated around ostium, with two parallel, lightly sclerotized ridges extending from posterolateral angles to anterior margin of segment, density of scales and setae increasing from anterior to posterior margins of sternum; tergum VIII densely setose on posterior margin, scales absent, anterior margin with two median projections; papillae anales with maximum width 0.31–0.36 the maximum length ( 5 n), bases of setae papillose, arranged in rows; lamella postvaginalis setose laterally and posteriorly, width at middle 0.58–0.68 length, with posterolateral angles weakly sclerotized, lateral margins slightly concave, anteromedial margin with triangular projection extending over ostium, anterolateral angles sharply pointed; lamella antevaginalis reduced and usually not evident; ductus bursae posteriorly with narrowly ovate, sinistral, sclerotized diverticulum (interpreted to be bulla seminalis), ductus seminalis arising from distal end of bulla seminalis, remainder of ductus bursae membranous; corpus bursae with small, rounded, membranous diverticulum near inception with ductus bursae, signa subequal in size, small, thornshaped. Eight preparations examined.
